    "xml_string": "<ITEM><BIBL><TITLE>der berühmte Hochbergische neue Berner-Krauter-Thee</TITLE>, das Paquet <PRIZE>8. Nappen</PRIZE> und das Pfund <PRIZE>1. fl.</PRIZE></BIBL> Item: <BIBL><TITLE>der berühmte Hochbergische neue Berner Blümlinoder Brust-Thee</TITLE>, das Paquet <PRIZE>12. Rappen</PRIZE> und das Pfund <PRIZE>20. Batzen</PRIZE></BIBL>. Item: <BIBL><TITLE>Edel extra seine Blümlin- und Brust-Thee</TITLE>, das Paquet ½ <PRIZE>22. Rappen</PRIZE></BIBL>; alle diese Thee räumen Gifft und Gallen, wie auch allen zehen Schleim von der Brust und aus dem Leib, wie in ihrem Bericht das mehrere zu ersehen. Item: <BIBL><TITLE>von soderbar guten Kräuteren und Blumen ein Fluß-Rauch-Taback</TITLE>, löset auf die versteckten Flüsse, stillet Haubt-Augen-Zahn-Hertz und Magen-Wehe, das Paquet <PRIZE>12. Rappen</PRIZE>, das Pfund <PRIZE>28. Batzen</PRIZE></BIBL>. Item: <BIBL><TITLE>Schneeberger Haupt-Fluß-Schnupf-Pulver</TITLE>, dienet wohl fur Haupt- und Zahn, Wehe, das Lädlin <PRIZE>12. Rappen</PRIZE>, und das Pfund <PRIZE>50. Batzen</PRIZE></BIBL>. Item: <BIBL><TITLE>Orientalisch Cephalique oder Blümlin-Taback</TITLE> mit einem extra herrlichen Geruch, löset und fähret aus das versiockte Blut und Flüsse aus dem Haupt, das Paquet <PRIZE>15. bis 30. Rappen</PRIZE></BIBL>. Item: <BIBL><TITLE>extra wohlriechender Orientalischer grenierter Blümlin-Taback</TITLE>, welcher eine subtile durchdringende Kraft hat versteckte Flüsse des Haubts auszufähren, das Paquet <PRIZE>12. bis 20. Rappen</PRIZE></BIBL>. Item: <BIBL><TITLE>Ein sonderbar wohlriechen, der Orientalischer gemeiner Blümlin-Taback</TITLE>, löset auf alle Haupt-Flüsse, und fähret sie aus, das Loth <PRIZE>12. Rappen</PRIZE> und das Pfund <PRIZE>30. Batzen</PRIZE></BIBL>. Item: <BIBL><TITLE>Romanische Pillen</TITLE>, dienen für die angesetzte Geschwulst und Brust-Wasser-Sucht, samt allem zehen Schleim auszufähren, die Prise <PRIZE>25. Rappen</PRIZE></BIBL>; Der mehrere Bericht über diese Romanische Pillen ist in des Hochgelehrten Herrn Doct. Christen aufrichtig ertheiltem Attestato zu ersehen, das Stuck für <PRIZE>6. Rappen</PRIZE>. Zu jedem Stuck obbemeldter Sachen ist ein nötiger Bericht beygelegt, von ihrem Gebrauch und Würckung.</ITEM>"
